// ZlbIndex.js
import React from 'react';
import { Link } from 'react-router-dom';
import './ZlbIndex.scss';
import indexLogo from '../../images/indexLogo.png';
import indexBackground from '../../images/indexBackground.png';

const ZlbIndex = () => {
  const containerStyle = {
    backgroundImage: `url(${indexBackground})`,
  };

  return (
    <Link to="/home" className="container" style={containerStyle}>
      <img className="logo" src={indexLogo} alt="Index Logo" />
    </Link>
  );
};

export default ZlbIndex;
